import React from 'react';
import Card from './Card';

const CardList = ({ corgis }) => {
    const cardArray = corgis.map(user, i => {
        return <Card key={i} id={corgis[i].id} name={corgis[i].name} owner={corgis[i].owner} personality={corgis[i].personality} />;
    });
    return (
        <div>
            {cardArray}
        </div>
    );
}

export default CardList;
